import './App.css';
import Main from './Components/Main'
import AboutUs from './Components/aboutUs'
import 'bootstrap/dist/css/bootstrap.min.css';
import {
  Routes,
  Route,
} from "react-router-dom"; 

function App() {
  return (
    <div>
      <Routes>
        <Route exact path='/' element={<Main />} />
        <Route path="/about" element={<AboutUs />} />
      </Routes>
    </div>
  );
}

export default App;
